  var canAdd = function(tag) {
    var items = []
    var values = $('.choices li').map(function() {
        var value = this.children[0].children[0].innerHTML.trim();
        if (value != undefined) {
            items.push(value);
        } 
    });
    if ((($.inArray(tag, beers) != -1) || ($.inArray(tag, features) != -1) || ($.inArray(tag, breweries) != -1)) && ($.inArray(tag, items) == -1)) {
      return true;
    }
    else {
      return false;
    }
  };
  $('#the-basics .typeahead').typeahead({
    hint: true,
    highlight: true,
    minLength: 1
  },
  { 
    name: 'beers',
    source: substringMatcher(beers),
    limit: 7
  });
  $('#the-features .typeahead').typeahead({
    hint: true,
    highlight: true,
    minLength: 1
  },
  {
    name: 'features',
    source: substringMatcher(features),
    limit: 7
  });
  $('#the-breweries .typeahead').typeahead({
    hint: true,
    highlight: true,
    minLength: 1
  },
  {
    name: 'breweries',
    source: substringMatcher(breweries),
    limit: 7
  });
  $("#the-basics .typeahead").blur(function(){
    var message = this.value;
    if ((message != "") && canAdd(message)) {
      $(this).val("");
      $(".choices").append(
        '<li class="choice">'
        + '<div class="search" tabindex="-1">x</a>'
        + '<div id="inner_message" style="display: inline; margin-left:0.25em;">'
        + message
        + '</div>'
        + '</li>');
    }
    document.getElementById("search-button").disabled = false;
  });
